import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'

const sidebar_options = {
    marginTop: {
        marginTop: "2vh"
    },
    blank: false,
    block: {
        item1: {
            title: "Add Movie",
            link: "/createMovie"
        },
        item2: {
            title: "View Movie",
            link: "/viewMovie"
        },
        item3: {
            title: "Multiview",
            link: "/multiview"
        }
    }

}

const HomePage = () => {
    return(
        <div className="single_page_background">
            <Navbar />
            <Sidebar input={sidebar_options}/>
        </div>
    );
}

export default HomePage
